import { createContext } from "react";

export const AuthContext = createContext({
    token: "",
    setToken: async (token: string) => {},
    getUserID: async () => { return "" },
    login: async (loginRequest: any) => { return {} },
    logout: async () => {},
    verifyToken: async () => { return false }
});
